sys_variable_value.value:
(function execute(inputs, outputs) {

var json = JSON.parse(inputs.responseBody);

	var temp = json.list[0].main.temp;
  	var weather = json.list[0].weather[0].description;
  	var wind = json.list[0].wind.speed;

  outputs.temperature = temp;
  outputs.weather = weather;
  outputs.wind = wind;

})(inputs, outputs);

